import React from 'react';
import StoreMenuItem from '../StoreMenuItem/StoreMenuItem';

const StoreMenu = props => (
    <div>
        <StoreMenuItem storeId = {0} storeName = 'АТБ'/>
        <StoreMenuItem storeId = {1} storeName = 'Сільпо'/>
    </div>
);

export default StoreMenu;
